window.bookSummaryJSON = "<p><b><i>An unstable vampire. A dangerous obsession. One woman stands between Cyneric and the annihilation of two worlds.</i></b></p> <p>He straddles two realms, the mortal world and the Unseen, yet he belongs nowhere. Once enslaved to the god Eros, Cyneric is now free and teetering on the edge of madness. No power in the multiverse can stop him, for he is a vampire like no other. Humans confound him, yet he cannot survive without their blood.</p> <p>Armed with irresistible seduction skills, the vampire Cyneric searches in vain for the object of his obsession. The stronger his fixation grows, the more volatile he becomes—until he stumbles onto the only mortal who isn't afraid of him.</p> <p>Will she save Cyneric? Or will he destroy them both?</p> <p><b><i>Cyneric</i></b><b> is the seventh book in the Undercover Elementals series of steamy paranormal romances and the first to be told exclusively from the hero's point of view.</b></p>"; 
